  d2s2_dph2  = s2_0_0_2*dphi2_d_d + s2_0_0_3*dphi3_d_d + s2_0_0_4*dphi4_d_d + s2_0_0_5*dphi5_d_d + s2_1_0_1*dphi_d_d*dr + s2_1_0_2*dphi2_d_d*dr + s2_1_0_3*dphi3_d_d*dr + s2_1_0_4*dphi4_d_d*dr + s2_2_0_1*dphi_d_d*dr2 + s2_2_0_2*dphi2_d_d*dr2 + s2_2_0_3*dphi3_d_d*dr2 + s2_3_0_1*dphi_d_d*dr3 + s2_3_0_2*dphi2_d_d*dr3 + s2_4_0_1*dphi_d_d*dr4 + s2_0_2_1*dphi_d_d*dtheta2 + s2_0_2_2*dphi2_d_d*dtheta2 + s2_0_2_3*dphi3_d_d*dtheta2 + s2_1_2_1*dphi_d_d*dr*dtheta2 + s2_1_2_2*dphi2_d_d*dr*dtheta2 + s2_2_2_1*dphi_d_d*dr2*dtheta2 + s2_0_4_1*dphi_d_d*dtheta4;
