  d2s2_dphdt = ds2dt_0_0_1*dphi_d + ds2dt_0_0_2*dphi2_d + ds2dt_0_0_3*dphi3_d + ds2dt_0_0_4*dphi4_d + ds2dt_1_0_1*dphi_d*dr + ds2dt_1_0_2*dphi2_d*dr + ds2dt_1_0_3*dphi3_d*dr + ds2dt_2_0_1*dphi_d*dr2 + ds2dt_2_0_2*dphi2_d*dr2 + ds2dt_3_0_1*dphi_d*dr3 + ds2dt_0_2_1*dphi_d*dtheta2 + ds2dt_0_2_2*dphi2_d*dtheta2 + ds2dt_1_2_1*dphi_d*dr*dtheta2;
